@MAStrackZi @dieLinke Heuchelei? Wir haben den Einsatz immer abgelehnt.
Aber jetzt geht es darum, die Menschen in Sicherheit zu bringen und nicht im Stich zu lassen. Die Bundesregierung hätte monatelang Zeit gehabt.
Warum hat die FDP dem Antrag zur Aufnahme der Ortskräfte im Juni nicht zugestimmt?

@Darkhor25227667 @neulandrebellen Nein. Es ist unvollständig und sinnentstellend zitiert, der letzte Halbsatz fehlt:

„Wer die Hospitalisierung zum Maßstab macht, ignoriert das Leid derer, die keinen schweren Verlauf haben, aber unter Langzeitfolgen leiden".
Long Covid trifft auch Menschen mit leichten Verläufen.

@neulandrebellen Bitte richtig und vollständig zitieren, der letzte Halbsatz fehlt:

„Wer die Hospitalisierung zum Maßstab macht, ignoriert das Leid derer, die keinen schweren Verlauf haben, aber unter Langzeitfolgen leiden".
Unter Long Covid leiden auch viele, die keinen schweren Verlauf hatten.

@FWiesm Das habe ich nicht behauptet. Die Frage war, ob es generell genug Hilfsangebote für psychisch Erkrankte gibt. Die gibt es leider nicht, das sagen auch die Deutsche Gesellschaft für Psychiatrie und der Bund der Kriminalbeamten:

